  const test = state.test;
  return {
    isLoggedIn,
    test,
    isRegistered,
    email,
    fullname,
    id
  };
};

const mapDispatchToProps = dispatch => {
  return {
    kitchenFetch: kitchens => dispatch(kitchenFetch(kitchens))
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(UserDashboard);
